description:
Домашний квас позволяет помогать организму в борьбе с разными недугами, и может служить настоящим семейным доктором. Его можно использовать в следующих случаях:
•	при пониженном обмене веществ;
•	при общей зашлакованности организма;
•	при высоком уровне холестерина в крови;
•	при высоких умственных и физических нагрузках;
•	при проблемах с пищеварением;
•	при нарушении микрофлоры кишечника;
•	при слабости, вялости, усталости;
